import { createMuiTheme } from "@material-ui/core/styles";
import "../../assets/css/font.css";

const primary = "#237FD0";
const primaryAlpha = "rgba(255, 255, 255, 0.15)";
const secondaryLighter = "rgba(250, 230, 97, 0.1)";
const secondary = "#F8DB1C";
const secondaryDark = "#E3C91E";
const secondaryHover = "#FAE661";
const error = "#FF3344";
const alert = "#FF5D00";
const success = "#67C453";
const successHover = "#7DCC6C";
const tabs = "#2374BB";
const tabsHover = "#237FD0";
const spot = "#FF00CC";
const hotel = "#97007C";
const air = "#0033FF";
const packageColor = "#FF5D00";
const primaryText = "#333";
const secondaryText = "#999";
const disabled = "#EFEFEF";
const border = "#DDD";
const offwhite = "#F2F5F8";
const white = "#FFF";
const white30 = "rgba(255,255,255, .3)";
const backdrop = "rgba(0,0,0, .3)";
const backdrop70 = "rgba(0,0,0, .7)";
const backdrop100 = "#000";
const canceled = "#FF3344";
const processed = "#FF5D00";
const approved = "#67C453";
const car = "#0074C5";

const bold = "HindMBold";
const regular = "HindMRegular";
const semibold = "HindMSemiBold";

const Theme = createMuiTheme({
    themeName: "sub",
    breakpoints: {
        values: {
            xs: 0,
            sm: 600,
            md: 960,
            lg: 1024,
            xl: 1280
        }
    },
    palette: {
        primary: {
            lighter: "rgba(255, 255, 255, 0.15)",
            light: "rgba(255, 255, 255, 0.15)",
            main: "#333333",
            dark: "#2B2B2B",
            darkHover: "#2B2B2B",
            alpha: primaryAlpha
        },
        secondary: {
            lighter: secondaryLighter,
            light: secondaryHover,
            main: secondary,
            dark: secondaryDark,
            contrastText: primaryText
        },
        error: { main: error },
        alert: { main: alert },
        success: {
            main: success,
            hover: successHover
        },
        text: {
            primary: primaryText,
            secondary: secondaryText,
            disabled
        },
        grey: {
            50: border,
            1000: offwhite
        },
        tabs: {
            main: tabs,
            hover: tabsHover
        },
        spot: { main: spot },
        hotel: { main: hotel },
        air: { main: air },
        package: { main: packageColor },
        car: { main: car },
        white: {
            main: white,
            alpha: white30
        },
        backdrop: {
            main: backdrop,
            dark: backdrop70,
            darker: backdrop100
        },
        canceled: { main: canceled },
        approved: { main: approved },
        processed: { main: processed },
        greyscale: { 3: "#CACACA" }
    },
    typography: {
        useNextVariants: true,
        color: primaryText,
        fontFamily: regular,
        fontSize: 16,
        h1: {
            fontFamily: bold,
            fontSize: "48px",
            lineHeight: "60px"
        },
        h2: {
            fontFamily: bold,
            fontSize: "36px",
            lineHeight: "40px"
        },
        h3: {
            fontFamily: bold,
            fontSize: "26px",
            lineHeight: "30px"
        },
        h4: {
            fontFamily: bold,
            fontSize: "22px",
            lineHeight: "28px"
        },
        h5: {
            fontFamily: bold,
            fontSize: "20px",
            lineHeight: "26px"
        },
        h6: {
            fontFamily: bold,
            fontSize: "18px",
            lineHeight: "24px"
        },
        subtitle1: { fontSize: "18px", lineHeight: "22px" },
        subtitle2: { fontSize: "16px", lineHeight: "20px" },
        subtitle3: { fontSize: "14px", lineHeight: "18px" },
        subtitle4: { fontSize: "12px", lineHeight: "16px" },
        caption: {
            color: primary,
            fontFamily: bold,
            fontSize: "14px",
            lineHeight: "18px"
        },
        body1: { fontSize: "16px" },
        body2: { fontSize: "14px" },
        body3: { fontSize: "12px" }
    },
    font: {
        regular,
        semibold,
        bold
    },
    shadows: [
        "0px 0px 0px 0px rgba(0,0,0,0.1)",
        "0px 0px 1px 0px rgba(0,0,0,0.1)",
        "0px 0px 2px 0px rgba(0,0,0,0.1)",
        "0px 0px 3px 0px rgba(0,0,0,0.1)",
        "0px 0px 4px 0px rgba(0,0,0,0.1)",
        "0px 0px 5px 0px rgba(0,0,0,0.1)",
        "0px 0px 6px 0px rgba(0,0,0,0.1)",
        "0px 0px 7px 0px rgba(0,0,0,0.1)",
        "0px 0px 8px 0px rgba(0,0,0,0.1)",
        "0px 0px 9px 0px rgba(0,0,0,0.1)",
        "0px 0px 10px 0px rgba(0,0,0,0.1)",
        "0px 0px 11px 0px rgba(0,0,0,0.1)",
        "0px 0px 12px 0px rgba(0,0,0,0.1)",
        "0px 0px 13px 0px rgba(0,0,0,0.1)",
        "0px 0px 14px 0px rgba(0,0,0,0.1)",
        "0px 0px 15px 0px rgba(0,0,0,0.1)",
        "0px 0px 16px 0px rgba(0,0,0,0.1)",
        "0px 0px 17px 0px rgba(0,0,0,0.1)",
        "0px 0px 18px 0px rgba(0,0,0,0.1)",
        "0px 0px 19px 0px rgba(0,0,0,0.1)",
        "0px 0px 20px 0px rgba(0,0,0,0.1)",
        "0px 0px 21px 0px rgba(0,0,0,0.1)",
        "0px 0px 22px 0px rgba(0,0,0,0.1)",
        "0px 0px 23px 0px rgba(0,0,0,0.1)",
        "0px 0px 24px 0px rgba(0,0,0,0.1)"
    ],
    level: {
        negative: -1,
        base: 0,
        content: 9,
        modal: 99,
        fixed: 999
    },
    container: { main: "1284px" }
});

export default Theme;
